package com.m800.zboss.billing.app.config;

import com.m800.zboss.lib.consts.BaseField;
import lombok.extern.slf4j.Slf4j;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.context.annotation.Configuration;
import org.springframework.statemachine.config.EnableStateMachine;
import com.m800.zboss.lib.dao.zboss.UsageFileQueueDao;
import org.springframework.statemachine.config.EnumStateMachineConfigurerAdapter;
import org.springframework.statemachine.config.builders.StateMachineConfigurationConfigurer;
import org.springframework.statemachine.config.builders.StateMachineStateConfigurer;
import org.springframework.statemachine.config.builders.StateMachineTransitionConfigurer;
import org.springframework.statemachine.StateContext;
import org.springframework.statemachine.action.Action;
import com.m800.zboss.lib.enums.UsageFileState;
import com.m800.zboss.lib.enums.UsageFileEvent;
import com.m800.zboss.billing.app.repository.zuora.UsageFileQueueRepository;
import com.m800.zboss.billing.app.repository.zuora.UsageFileLogRepository;
import java.util.EnumSet;

@Configuration
@EnableStateMachine
@Slf4j
public class UsageFileStateMachineConfig extends EnumStateMachineConfigurerAdapter {
 @Autowired
 private UsageFileQueueRepository usageFileQueueRepository;

 @Autowired
 private UsageFileLogRepository usageFileLogRepository;

 @Override
 public void configure(StateMachineConfigurationConfigurer config) throws Exception {
 config.withConfiguration().autoStartup(true);
 }

 @Override
 public void configure(StateMachineStateConfigurer states) throws Exception {
 states.withStates()
 .initial(UsageFileState.Waiting)
 .states(EnumSet.allOf(UsageFileState.class));
 }

 @Override
 public void configure(StateMachineTransitionConfigurer transitions) throws Exception {
 transitions
 .withExternal()
 .target(UsageFileState.Waiting)
 .event(UsageFileEvent.Waiting)
 .action(initWaitingAction())
 .and()
 .withExternal()
 .source(UsageFileState.Waiting)
 .target(UsageFileState.Processing)
 .event(UsageFileEvent.Start\_Processing)
 .action(processingTransitionAction())
 .and()
 .withExternal()
 .source(UsageFileState.Processing)
 .target(UsageFileState.Completed)
 .event(UsageFileEvent.Processing\_Completed)
 .action(completedTransitionAction())
 .and()
 .withExternal()
 .source(UsageFileState.Processing)
 .target(UsageFileState.Failed)
 .event(UsageFileEvent.Processing\_Failed)
 .action(failedTransitionAction());
 }

 private Action initWaitingAction() {
 return new Action() {
 @Override
 public void execute(StateContext context) {
 String accountNumber =
 (String) context.getMessage().getHeaders().get(BaseField.AccountNumber);
 String subscriptionNumber =
 (String) context.getMessage().getHeaders().get(BaseField.SubscriptionNumber);
 UsageFileQueueDao usageFileQueueDao
 = new UsageFileQueueDao(accountNumber, subscriptionNumber);

 UsageFileQueueDao currentQueue =
 usageFileQueueRepository
 .findQueueWithSubscriptionStatus(
 subscriptionNumber, UsageFileState.Waiting);
 if (currentQueue == null) {
 usageFileQueueRepository.insert(UsageFileQueueDao.class, usageFileQueueDao);
 }
 }
 };
 }
 private Action processingTransitionAction() {
 return new Action() {
 @Override
 public void execute(StateContext context) {
 String id = (String) context.getMessage().getHeaders().get(BaseField.ID);
 usageFileQueueRepository
 .updateStatusById(id, UsageFileState.Waiting, UsageFileState.Processing);
 }
 };
 }

 private Action completedTransitionAction() {
 return new Action() {
 @Override
 public void execute(StateContext context) {
 String id = (String) context.getMessage().getHeaders().get(BaseField.ID);
 UsageFileQueueDao usageFileQueue =
 usageFileQueueRepository
 .updateStatusById(
 id, UsageFileState.Processing, UsageFileState.Completed);
 usageFileLogRepository.insert(UsageFileQueueDao.class, usageFileQueue);
 usageFileQueueRepository.deleteById(id);
 }
 };
 }

 private Action failedTransitionAction() {
 return new Action() {
 @Override
 public void execute(StateContext context) {
 String id = (String) context.getMessage().getHeaders().get(BaseField.ID);
 UsageFileQueueDao usageFileQueue =
 usageFileQueueRepository
 .updateStatusById(
 id, UsageFileState.Processing, UsageFileState.Failed);
 usageFileLogRepository.insert(UsageFileQueueDao.class, usageFileQueue);
 usageFileQueueRepository.deleteById(id);
 }
 };
 }
}
